import "./Header.css";
import React, { useState } from "react";
import { Typography, Button, Divider, Box, Grid } from "@mui/material";
import logo from "../asset/logo.png";

function Header() {
    const [value, setValue] = useState(0);

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };
  return (
    <>
      <div id="header">
        <Box
          sx={{
            display: "grid",
            alignItems: "center",
            width: "100%",
            borderRadius: 1,
            color: "text.secondary",
            "& svg": {
              m: 1.5,
            },
            "& hr": {
              mx: 0.5,
            },
          }}
        >
          <Grid container spacing={10}>
            <Grid item xs={1}>
              <Typography align="left">
                <a href="/">
                  <img
                    href="/"
                    src={logo}
                    style={{ marginTop: "0%", height: "40px" }}
                  ></img>
                </a>
              </Typography>
            </Grid>
            <Grid item xs={2}>

            </Grid>
            <Grid item xs={1}>
                <Button>
                HOME
                </Button>
            </Grid>
            <Grid item xs={1}>
                <Button>
                Create
                </Button>
            </Grid>
            <Grid item xs={1}>
                <Button>
                CHART
                </Button>
            </Grid>
            <Grid item xs={1}>
                <Button>
                BOARD
                </Button>
            </Grid>
            <Grid item xs={2}></Grid>
            <Grid item xs={1}>
            <Divider/>

            </Grid>

            <Grid item xs={2}>

              <Button align="right" marginRight={"3vw"}>
                <a href="/login">로그인</a>
              </Button>
            </Grid>
          </Grid>
        </Box>
      </div>
    </>
  );
}

export default Header;
